const DETHER_IS_YUV=false;

function KDTreeNode(location,left,right)
{
    this.location=location;
    this.left=left;
    this.right=right;
    return this;
}

function searchKDTreeNearest(tree,value)
{
    let nearPath=nearestTreePath(tree,value);
    let minD=Infinity,nearestValue=null,nearestIndex=null;
    let stack=[];
    nearPath.forEach((_,i,a)=>
    {
        let p=a.slice(0,i);
        p.push(+!a[i]);
        stack.push(p);
    });
    stack.push(nearPath);

    while(stack.length>0)
    {
        //console.log(stack.map(x=>x.join('')))
        let path=stack.pop();
        if(!isPoints(path))
        {
            if(isBoxNear(path))stack.push(path.concat(0),path.concat(1));
            continue;
        }


        calcLocalNearest(path);
        //console.log(minD,nearestValue);
        path.pop();
    }

    return {value:nearestValue,index:nearestIndex};

    function isPoints(path)
    {
        return getNode(tree,path).location===undefined;
    }

    function calcLocalNearest(path)
    {
        let points=getNode(tree,path);
        if(points.location!==undefined)throw new Error(`path (${path.join(', ')}) is not points`);

        points.forEach(p=>
        {
            let d=p.value.reduce((a,c,i)=>a+(c-value[i])**2,0);
            if(d<minD)
            {
                minD=d;
                nearestValue=p.value;
                nearestIndex=p.index;
            }
        });
    }

    function isBoxNear(path)
    {
        let box=getBox(tree,path);

        let lens=[];
        for(let i=box[0].length-1;i>=0;i--)
        {
            lens.push(box[0][i]-value[i],value[i]-box[1][i]);
        }
        let dis=lens.reduce((a,c)=>a+(c>0?c**2:0),0);
        return minD>=dis;
    }

    function getNode(tree,path)
    {
        let t=tree;
        path.forEach((p,depth)=>
        {
            let axis=depth%3;
            t=t[p?'right':'left'];
        });
        return t;
    }

    function getBox(tree,path)
    {
        let t=tree,box=DETHER_IS_YUV?[[-Infinity,-Infinity,-Infinity],[Infinity,Infinity,Infinity]]:[[0,0,0],[256,256,256]];
        path.forEach((p,depth)=>
        {
            let axis=depth%3;
            box[+!p][axis]=t.location;
            t=t[p?'right':'left'];
        });
        return box;
    }

    function nearestTreePath(tree,value)
    {
        let t=tree,depth=0,path=[];
        while(t.location!==undefined)
        {
            let axis=depth%3;
            let isRight=value[axis]>=t.location;
            path.push(+isRight);
            t=t[isRight?'right':'left'];
            depth++;
        }
        return path;
    }
}

function makePaletteKDTree(arr,targetDepth=3*4)
{
    function kdtree(points,depth)
    {
        if(depth>=targetDepth)
        {
            return points;
        }
        let axis=depth%3;

        points.sort((a,b)=>a.value[axis]-b.value[axis]);
        let median=points[Math.floor(points.length/2)].value[axis];
        
        let medianFirstIndex=Math.floor(points.length/2),isAllSame=true;
        for(let i=0;i<=points.length/2;i++)
        {
            let lv=points[medianFirstIndex-i-1];
            let rv=points[medianFirstIndex+i+1];
            if(lv!==undefined&&lv.value[axis]!=median)
            {
                medianFirstIndex-=i;
                isAllSame=false;
                break;
            }
            if(rv!==undefined&&rv.value[axis]!=median)
            {
                medianFirstIndex+=i;
                median=rv.value[axis];
                isAllSame=false;
                break;
            }
        }
        if(isAllSame)return points;

        let left=kdtree(points.slice(0,medianFirstIndex),depth+1);
        let right=kdtree(points.slice(medianFirstIndex),depth+1);
        return new KDTreeNode(median,left,right);
    }

    return kdtree(arr.map((x,i)=>({value:x,index:i})),0);
}

function rgb2yuv(r,g,b)
{
    let y=.299*r+.587*g+.114*b;
    return[y,(b-y)*.565,(r-y)*.713];
}

function yuvKDTreeInit(colors)
{
    if(DETHER_IS_YUV)
        return makePaletteKDTree(colors.map(x=>rgb2yuv(...x)));
    else
        return makePaletteKDTree(colors);
}

const legacyYUVTree=yuvKDTreeInit(colors);
const YUVTree=yuvKDTreeInit(colors2);

function dether(im,w,h,opt={})
